import operator

def kmerCount(dna, num):
    dict = {}
    for i in range(len(dna) - num):
        subStr = dna[i:i+num]
        if (dict.get(subStr)):
            dict[subStr] = dict[subStr] + 1
        else:
            dict[subStr] = 1
    highest =  max(dict.values())
    arr = ([k for k, v in dict.items() if v == highest])
    return ' '.join(arr)

